import React, { useState, useEffect } from 'react';
import NavBar from '../components/NavBar';
import login from '../Login';

const Home = () => {
  const [loginInfo, setLoginInfo] = useState(null);

  useEffect(() => {
    const info = login();
    setLoginInfo(info);
    console.log('hissi');
  }, []);

  if (loginInfo) {
    return (
      <div>
        <NavBar currentPage={'Home'} />
        <div>Welcome, {loginInfo.username}</div> {/* Assuming loginInfo contains a 'username' property */}
      </div>
    );
  } else {
    return (
      <div>
        <div>Not logged in</div>
      </div>
    );
  }
};

export default Home;
